import { Route, Redirect, Switch } from "react-router";
import AdminProfile from "./AdminProfile/AdminProfile";

export default function Admin() {
  const getUser = () => {
    return (
      <Switch>
        <Route path="/admin/profile">
          <AdminProfile />
        </Route>
        <Route path="/admin/coupons">Admin coupons</Route>
        <Route path="/admin/companies">Admin purchase</Route>
        <Route path="/admin/customers">Admin purchase</Route>
        <Route path="/admin/logs">Admin purchase</Route>
        <Route path="/admin">
          <Redirect to="/admin/home" />
          Admin home
        </Route>
      </Switch>
    );
  };
  return <div className="Admin">{getUser()}</div>;
}
